import React from 'react'

const Catalog = () => {
    return (
        <div>
            <div className={s.content}>
                <div className={s.title}>Browse</div>
                <div className={s.text}>Explore our catalog for your next favorite game!</div>
                <div className={s.btn}>
                    <a>Browse all</a>
                </div>
            </div>
        </div>
    )
}

export default Catalog;
